import React from "react";

const axios = require('axios').default;

async function App() {
  try {
    const ticket = await axios.get("http://52.10.102.239/tickets/");

    return (
      <React.Fragment>
        <tr>
          <th scope="row">{ ticket[0].id }</th>
          <td>{ ticket.email }</td>
          <td>Otto</td>
          <td>@mdo</td>
          <td>@mdo</td>
        </tr>
      </React.Fragment>);

    } catch (error) {
    console.log(error)
  }
}

export default App;
